column13:
The present invention concerns a method and a system for managing a guided vehicle movement authority, the method comprising the following steps: 
- sending, by means of a Trackside Centralized Movement Authority Generator (hereafter TCMAG) (4) to an on-board system (20) of a guided vehicle A, a request for checking an occupancy state of a part of the first section (10) located ahead the guided vehicle A if a distance between a position of the guided vehicle A on the track and a boundary (15) between the first section (10) and the second section (11) is smaller than a predefined distance; 
- if no guided vehicle B is detected in front of the guided vehicle A, then automatically sending a message to the TCMAG (4) informing the latter about a vacant state of the part of the first section (10) ahead the guided vehicle A; 
- automatically issuing by means of the TCMAG (4) a movement authority to the on-board system (20) if and only if the occupancy state of the second section (11) is in a vacant state and if the message informing about the vacant state of the part of the first section ahead the guided vehicle is received by the TCMAG, otherwise preventing an issuance of a movement authority to the guided vehicle A.
